import React from "react";
import "../css/Header.css";
import logo from "../img/logo.png";

//함수형 컴포넌트
function Header() {
    return (
    <div>
        <img src={logo}></img>
        <div class="header">
            키미노 나마에와
        </div>
    </div>
    );
}

export default Header;
